import React from 'react'

const RegisterModal = () => {
  const [show, setShow] = React.useState(false)

  React.useEffect(() => {
    setTimeout(() => {
      setShow(true)
    }, 1000)
  }, [show])

  if (!show) return null

  return <>OK, Render</>
}

export default RegisterModal
